import React from 'react';
import './Skills.css';
function Skills() {

  const skills = [
    // Programming
    { id: 1, title: 'Java', description: 'Description de la compétence', xp: '3 years', level: 'Advanced', image: 'java.png' },
    { id: 2, title: 'JavaScript', description: 'Description de la compétence', xp: '3 years', level: 'Intermediate', image: 'js.png' },
    { id: 3, title: 'React.js', description: 'Description de la compétence', xp: '6 months', level: 'Beginner', image: 'react.png' },
    { id: 4, title: 'C', description: 'Description de la compétence', xp: '3 months', level: 'Beginner', image: 'c.png' },
    { id: 5, title: 'HTML', description: 'Description de la compétence', xp: '3 years', level: 'Intermediate', image: 'html.png' },
    { id: 6, title: 'PHP', description: 'Description de la compétence', xp: '3 months', level: 'Novice', image: 'php.png' },
    { id: 7, title: 'React Native', description: 'Description de la compétence', xp: '6 months', level: 'Beginner', image: 'react-native.png' },
    { id: 8, title: 'Swift', description: 'Description de la compétence', xp: '1 year', level: 'Intermediate', image: 'swift.png' },
    { id: 9, title: 'MySQL', description: 'Description de la compétence', xp: '1 year', level: 'Beginner', image: 'mysql.png' },
    { id: 10, title: 'Git', description: 'Description de la compétence', xp: '3 year', level: 'Intermediate', image: 'git.png' },
    // Security
    { id: 11, title: 'Kali', description: 'Description de la compétence', xp: '3 years', level: 'Moderate', image: 'kali.png' },
    { id: 12, title: 'KQL', description: 'Description de la compétence', xp: '6 months', level: 'Beginner', image: 'kql.png' },
    { id: 13, title: 'Splunk', description: 'Description de la compétence', xp: '6 months', level: 'Beginner', image: 'splunk.png' },
    { id: 15, title: 'Microsoft Defender', description: 'Description de la compétence', xp: '6 months', level: 'Beginner', image: 'defender.png' },
    { id: 16, title: 'Sysmon', description: 'Description de la compétence', xp: '6 months', level: 'Beginner', image: 'sysmon.png' },
    { id: 17, title: 'MITRE ATT&CK', description: 'Description de la compétence', xp: '6 months', level: 'Beginner', image: 'mitre.png' },
    { id: 18, title: 'OWASP Top 10', description: 'Description de la compétence', xp: '6 months', level: 'Beginner', image: 'owasp.png' },
    { id: 19, title: 'Bash', description: 'Description de la compétence', xp: '2 years', level: 'Beginner', image: 'linux.png' },
  ];

  return (
    <div className="skills-container">
      <div className="skill-thumbnails">
        {skills.map(skill => (
          <div key={skill.id} className="skill-thumbnail">
            <div className="thumbnail-image-s">
              <img src={skill.image} alt={skill.title} />
            </div>
            <div className="skill-details">
              <h2>{skill.title}</h2>
              <p className='xp'>{skill.xp} </p>
              <p className='level'>{skill.level} </p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Skills;
